import React, { Component } from 'react'

export  class Items extends Component {
  render() {
    return (
      <div className='item'>
        <img src={''}/>
        <h2>{this.props.Items}</h2>
        <p></p>
        <b></b>
        <div></div>
      </div>
    )
  }
}

export default Items
